var findMaxLength = function (nums) {
  const s = [0]
  let sum = 0
  for (let i = 0; i < nums.length; i++) {
    sum += nums[i]
    s.push(sum)
  }
  let ans = 0
  for (let i = 1; i < nums.length; i++) {
    for (let j = 0; j < i && i - j > ans; j++) {
      if ((s[i + 1] - s[j]) * 2 === i + 1 - j) {
        ans = Math.max(ans, i - j + 1)
      }
    }
  }
  return ans
}

